		+'				<b>'+ translate('Coordinates') +':&nbsp;</b>&nbsp;'
		+'			</td>'
		+'			<td>'
		+'				<b>X:</b> '
		+'				<input id=' + setUID('Tabs.Attacks.tabMaps.coord_x') + ' size=3 maxlength=3 type=text value="' + Data.options.map.x + '" /> '
		+'				<b>Y:</b> '
